import React from "react";

const Padding_Middle = ({ title, cover, describe, right = false }) => {
  return (
    <section
      className={`min-h-screen padding flex md:${
        right ? "flex-row-reverse" : "flex-row"
      }`}
    >
      <div className="">
        {item.image.endsWith(".mp4") || item.image.endsWith(".webm") ? (
          <video autoPlay muted loop className="bg-fullobject w-full">
            <source
              src={item.image}
              type={`video/${item.image.split(".").pop()}`}
            />
            Your browser does not support the video tag.
          </video>
        ) : (
          <img
            src={item.image}
            alt={item.title}
            className="w-full bg-fullobject"
          />
        )}
      </div>
    </section>
  );
};

export default Padding_Middle;
